import React, {Component} from 'react';
import Linkify from 'react-linkify';

class DisplayCostume extends Component {
    constructor(props){
        super(props);
    }

    render(){
        <Linkify>{this.props.costumeData.costumes}</Linkify>
        
    }
}

export default DisplayCostume;
